public V get(K key) {
  if (!isEnabled) {
    return null;
  }

  V result = cache.getIfPresent(key);
  if (result == null) {
    LOG.debug("{}: CACHE MISS: {}", label, key.toString());
  }
  else {
    LOG.debug("{}: CACHE HIT: {}, {}", label, key.toString(), result.toString());
  }
  return result;
}
